import React from 'react';
import banner from '../assets/images/Banner1.png'; // Chemin relatif vers l'image
import logo from '../assets/images/logo.png';

const Home = () => {
  return (
    <div className="home">
      <header className="home-header">
        <img src={logo} alt="Kasa logo" className="home-logo" />
      </header>
      <div className="home-banner">
        <img src={banner} alt="Kasa banner" className="home-banner-img" />
      </div>
      <div className="home-content">
        {/* Ajoutez le contenu principal de la page ici */}
      </div>
    </div>
  );
};
export default Home;
